class Employees extends Component {
    state = {
        currentSection: "personal"
    };


    renderView = () => {
        const ComponentName = enumObj[this.state.currentSection];
        return <ComponentName />
    }

    render() {
        return (
            <div>
                <ProfileNav />
                {this.renderView()}
            </div>
        )
    }
}


export default Employees;
